import React from 'react'
import Hero from './components/hero/hero';
import Form from './components/auth/form';
import { Router, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Hero/>
        <Route exact path= "/components/auth/form.js" element={<Form/>}/>
      </Router>
    </div>
  );
}

export default App;
